(66, 'index.php?option=com_content&view=article&id=8', 'index.php?option=com_content&view=article&id=8:beginners&catid=19&Itemid=260', 'Beginners', ' If this is your first Joomla! site or your first web site, you have come to the right place. Joomla will help you get your website up and running quickly and easily. Start off using your site by logging in using the administrator account you created when', '2016-02-24 18:00:21', '313ef968c945dad96caa9c0e3b482853', 1, 1, 1, '*', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', 0, 0, 4, ),
(67, 'index.php?option=com_content&view=article&id=9', 'index.php?option=com_content&view=article&id=9:contact&catid=21&Itemid=260', 'Contacts', ' The contact component provides a way to provide contact forms and information for your site or to create a complex directory that can be used for many different purposes. Help ', '2016-02-24 18:00:23', '831bc3730b0bc4052a3b72414d977bd2', 1, 1, 1, '*', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', 0, 0, 4, ),
(68, 'index.php?option=com_content&view=article&id=10', 'index.php?option=com_content&view=article&id=10:content&catid=21&Itemid=260', 'Content', ' The content component (com_content) is what you use to write articles. It is extremely flexible and has the largest number of built in views. Articles can be created and edited from the front end, making content the easiest component to use to create you', '2016-02-24 18:00:23', '4e8ea23439ff50914e8f1b2a08866533', 1, 1, 1, '*', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', 0, 0, 4, ),
(69, 'index.php?option=com_content&view=article&id=21', 'index.php?option=com_content&view=article&id=21:getting-help&catid=19&Itemid=260', 'Getting Help', ' There are lots of places you can get help with Joomla!. In many places in your site administrator you will see the help icon. Click on this for more information about the options and functions of items on your screen. Other places to get help are: Suppor', '2016-02-24 18:00:24', '1644b4cc9ef33a8139af0d1292620e44', 1, 1, 1, '*', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', 0, 0, 4, );
