(70, 'index.php?option=com_content&view=article&id=22', 'index.php?option=com_content&view=article&id=22:getting-started&catid=19&Itemid=260', 'Getting Started', ' It''s easy to get started creating your website. Knowing some of the basics will help. What is a Content Management System? A content management system is software that allows you to create and manage webpages easily by separating the creation of your con', '2016-02-24 18:00:25', 'a1a50bfa56e44c6882b668c083ec1394', 1, 1, 1, '*', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', 0, 0, 4, ),
(71, 'index.php?option=com_content&view=article&id=24', 'index.php?option=com_content&view=article&id=24:joomla&catid=19&Itemid=260', 'Joomla!', ' Congratulations! You have a Joomla site! Joomla makes it easy to build a website just the way you want it and keep it simple to update and maintain. Joomla is a flexible and powerful platform, whether you are building a small site for yourself or a huge ', '2016-02-24 18:00:27', 'f6d7e90ae1262e0fa741fc9a7901cc60', 1, 1, 1, '*', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', 0, 0, 4, ),
(72, 'index.php?option=com_content&view=article&id=32', 'index.php?option=com_content&view=article&id=32:options&catid=19&Itemid=260', 'Options', ' As you make your Joomla! site you will control the details of the display using options also referred to as parameter s . Options control everything from whether the author''s name is displayed to who can view what to the number of items shown on a list. ', '2016-02-24 18:00:29', 'b7d2d852a34c85f097361aaa83f9a841', 1, 1, 1, '*', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', 0, 0, 4, );
