(74, 'index.php?option=com_content&view=article&id=38', 'index.php?option=com_content&view=article&id=38:sample-sites&catid=19&Itemid=260', 'Sample Sites', ' Your installation includes sample data, designed to show you some of the options you have for building your website. In addition to information about Joomla! there are two sample "sites within a site" designed to help you get started with building your o', '2016-02-24 18:00:32', '0eefb3ed9eb6ee610e88ce380a4359e5', 1, 1, 1, '*', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', 0, 0, 4, ),
