(76, 'index.php?option=com_content&view=article&id=47', 'index.php?option=com_content&view=article&id=47:the-joomla-community&catid=19&Itemid=260', 'The Joomla! Community', ' Joomla means All Together, and it is a community of people all working and having fun together that makes Joomla possible. Thousands of people each year participate in the Joomla community, and we hope you will be one of them. People with all kinds of sk', '2016-02-24 18:00:36', 'f11866ee7844b444d43ddfb62a3fd59f', 1, 1, 1, '*', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', 0, 0, 4, ),
(77, 'index.php?option=com_content&view=article&id=48', 'index.php?option=com_content&view=article&id=48:the-joomla-project&catid=19&Itemid=260', 'The Joomla! Project', ' The Joomla Project consists of all of the people who make and support the Joomla Web Platform and Content Management System. Our mission is to provide a flexible platform for digital publishing and collaboration. The core values are: Freedom Equality Tru', '2016-02-24 18:00:38', '3478702b8bcb4fa40c52133779694ebe', 1, 1, 1, '*', '2011-01-01 00:00:01', '0000-00-00 00:00:00', '2011-01-01 00:00:01', '0000-00-00 00:00:00', 0, 0, 4, ),
