(165, 313, 'fabrica Carousel for VirtueMart', '', '', 1, '', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_vina_manufacturers_virtuemart', 1, 0, '{"showImage":"1","linkOnImage":"0","showName":"1","linkOnName":"1","moduleWidth":"100%","moduleHeight":"auto","moduleMargin":"0px","modulePadding":"30px 0 0","itemMargin":"0 5px","bgImage":"","isBgColor":"1","bgColor":"#ffffff","captionBgColor":"#ffffff","captionColor":"#525252","pagination":"1","bgPagination":"#ffffff","colorPagination":"#cccccc","bgPaginationActive":"#ededed","colorPaginationActive":"#ffffff","navigation":"1","noItems":"null","circular":"1","infinite":"1","direction":"left","align":"center","auto":"1","mousewheel":"1","mouseSwipe":"1","touchSwipe":"1","scrollItems":"null","fx":"directscroll","easing":"linear","duration":"500","pauseOnHover":"1","moduleclass_sfx":"","cache":"1","cache_time":"900","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(166, 314, 'Otras unidades ', '', '<div class="sppb-row">\r\n<div class="sppb-col-sm-4">\r\n<div class="sppb-addon-container border-global">\r\n<div class="sppb-custom-text-wrapper scholarship-info">\r\n<h3 class="custom-text-title" style="padding-bottom: 25px;">Logística de la Salud</h3>\r\n<img style="width: 100%;" src="images/logistica.png" alt="Logística de la Salud " />\r\n<p>Ofrecemos al sector salud las mejores soluciones en los procesos de logística de mercancía a las empresas importadoras y exportadoras de productos médicos, conocemos muy bien el trámite especial que se requiere y el mejor método para que su mercancía no sufra contratiempos, es por eso que nos dedicamos única y exclusiva mente al sector salud, nuestro grupo de trabajo cuenta con personal en varios países de Latinoamérica y con muchos años de experiencia en el sector.</p>\r\n<a href="#">Más información </a></div>\r\n</div>\r\n</div>\r\n<div class="sppb-col-sm-4">\r\n<div class="sppb-addon-container border-global">\r\n<div class="sppb-custom-text-wrapper scholarship-info">\r\n<h3 class="custom-text-title" style="padding-bottom: 25px;">Asesoría Normativas En Salud</h3>\r\n<img style="width: 100%;" src="images/procesos.png" alt="Asesoría Normativas En Salud " />\r\n<p>Asesoramos y tramitamos todo lo relación a la normativa gubernamental que se requiere en el país para las empresas del sector médico, conocemos muy bien los trámites que se requieren para comercializar, fabricar, distribuir y habilitar productos o servicios médicos, poniendo a su disposición el conocimiento de personas expertas con muchos años de experiencias en el sector médico.</p>\r\n<br /> <a href="#">Más información </a></div>\r\n</div>\r\n</div>\r\n<div class="sppb-col-sm-4">\r\n<div class="sppb-addon-container border-global">\r\n<div class="sppb-custom-text-wrapper scholarship-info">\r\n<h3 class="custom-text-title" style="padding-bottom: 25px;">Marketing para el Sector Salud</h3>\r\n<img style="padding: 0 10px 10px 0;" src="images/marketing.png" alt="Marketing para el Sector Salud " />\r\n<p>Somos una compañía experta en Marketing y conocemos muy bien el sector salud, para lo cual ofrecemos las mejores soluciones y propuestas que su empresa necesita, tenemos un grupo de trabajo interdisciplinario con el que planteamos novedosas y efectivas estrategias de BTL (below the line) Medios masivos (ATL) estrategias combinadas (TTL), difusión en redes sociales (SMO), correo masivo (E-mailing), Posicionamiento web (SEM-SEO), entre otras.</p>\r\n<br /> <a href="#">Más información </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<p><br /><br /></p>\r\n<div class="sppb-row">\r\n<div class="sppb-col-sm-12">\r\n<p style="text-align: center;"><em>"Déjenos hacer lo nuestros y aproveche su tiempo en lo que más conoce"</em></p>\r\n</div>\r\n</div>\r\n<p><br /><br /> <br /><br /></p>\r\n<div class="row">\r\n<div class="sppb-col-sm-2"> </div>\r\n<div class="sppb-col-sm-1"><img style="display: block; margin-left: auto; margin-right: auto;" src="images/minsalut-mini.png" alt="" /></div>\r\n<div class="sppb-col-sm-1"><img style="display: block; margin-left: auto; margin-right: auto;" src="images/mintic-mini.png" alt="" /></div>\r\n<div class="sppb-col-sm-1"><img style="display: block; margin-left: auto; margin-right: auto;" src="images/mintrabajo-mini.png" alt="" /></div>\r\n<div class="sppb-col-sm-1"><img style="display: block; margin-left: auto; margin-right: auto;" src="images/invima-miniatura.png" alt="" /></div>\r\n<div class="sppb-col-sm-1"><img style="display: block; margin-left: auto; margin-right: auto;" src="images/vive-mini.png" alt="" /></div>\r\n<div class="sppb-col-sm-1"><img style="display: block; margin-left: auto; margin-right: auto;" src="images/todos-min.png" alt="" /></div>\r\n<div class="sppb-col-sm-1"><img style="display: block; margin-left: auto; margin-right: auto;" src="images/pro-mini.png" alt="" /></div>\r\n<div class="sppb-col-sm-1"><img style="display: block; margin-left: auto; margin-right: auto;" src="images/app-mini.png" alt="" /></div>\r\n<div class="sppb-col-sm-2"> </div>\r\n</div>', 1, '', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"0","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
