INSERT INTO `g94b3_virtuemart_products_es_es` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1, 'Absolutamente una característica especial de la historia de nuestra empresa 125-yearold - la ERKA sensitve Porsche Design Jubilee Edition fascina por el estilo inconfundible de Porsche ICÓNICO: funcionalmente, atemporal y purista. El concepto de diseño precisa vinculada con el arte tradicional del arte hace que este estetoscopio para su obra maestra exclusiva.', '<p><span style="color: #555659; font-family: ''Century Gothic'', Verdana, sans-serif; font-size: 12px; line-height: 18px; text-align: justify;">Absolutamente una característica especial de la historia de nuestra empresa 125-yearold - la ERKA sensitve Porsche Design Jubilee Edition fascina por el estilo inconfundible de Porsche ICÓNICO: funcionalmente, atemporal y purista. El concepto de diseño precisa vinculada con el arte tradicional del arte hace que este estetoscopio para su obra maestra exclusiva.</span></p>', 'Estetoscopios Sensible Porsche Design', '', '', '', 'estetoscopios-sensible-porsche-design'),
(2, 'El A100 aneroide debe ser inflado manualmente e incluye un estetoscopio y bolsa de transporte. Cuenta con una abrazadera de metal para enganchar calibre, y es Ø 50 x 90 mm. Su peso es de 110 gramos y el rango de medición es 40-260mmHg. Su rango de presión es 0-300mmHg y la precisión es de 3 mmHg. El manguito para adultos es de 22-32cm, y hay una garantía de dos años.', '<p><span style="color: #555659; font-family: ''Century Gothic'', Verdana, sans-serif; font-size: 12px; line-height: 18px; text-align: justify;">El A100 aneroide debe ser inflado manualmente e incluye un estetoscopio y bolsa de transporte. </span><span style="color: #555659; font-family: ''Century Gothic'', Verdana, sans-serif; font-size: 12px; line-height: 18px; text-align: justify;">Cuenta con una abrazadera de metal para enganchar calibre, y es Ø 50 x 90 mm. </span><span style="color: #555659; font-family: ''Century Gothic'', Verdana, sans-serif; font-size: 12px; line-height: 18px; text-align: justify;">Su peso es de 110 gramos y el rango de medición es 40-260mmHg. </span><span style="color: #555659; font-family: ''Century Gothic'', Verdana, sans-serif; font-size: 12px; line-height: 18px; text-align: justify;">Su rango de presión es 0-300mmHg y la precisión es de 3 mmHg. </span><span style="color: #555659; font-family: ''Century Gothic'', Verdana, sans-serif; font-size: 12px; line-height: 18px; text-align: justify;">El manguito para adultos es de 22-32cm, y hay una garantía de dos años.</span></p>', 'Manguito de esfigmomanómetro montado', '', '', '', 'manguito-de-esfigmomanómetro-montado'),
(3, 'SU MÉDICO ha confiado en ERKA durante 125 años. USTED puede hacer lo mismo. Durante los últimos 125 años, millones de médicos de todo el mundo se han convencido de la exactitud y la calidad de nuestros monitores de presión arterial. Hemos incorporado esta confianza', '', 'Monitor de presión arterial automático', '', '', '', 'monitor-de-presión-arterial-automático'),
(4, 'Combinación única en el mundo de las dos terapias más eficaces en una sola unidad\r\nAmplia gama de indicaciónes clínicas\r\nResultados maximizados de tratamiento mediante\r\nel uso de ambas modalidades en una sola sesión\r\nTratamiento eficaz del dolor y aceleración del proceso \r\nde recuperación', '<p class="MsoNormal">CARACTERÍSTICAS PRINCIPALES</p>\r\n<p class="MsoNormal">LÁSER DE ALTA INTENSIDAD</p>\r\n<p class="MsoNormal">• Penetración profunda del tejido con potencia de hasta 7 W en modo continuo</p>\r\n<p class="MsoNormal">• Efecto terapéutico máximo utilizando la longitud de onda de 1.064 nm</p>\r\n<p class="MsoNormal">• Modo pulsátil para la eliminación inmediata del dolor</p>\r\n<p class="MsoNormal">• Seguridad máxima</p>\r\n<p class="MsoNormal">TERAPIA DE ONDAS DE CHOQUE</p>\r\n<p class="MsoNormal">• Solución única, no invasiva para el dolor musculoesquelético</p>\r\n<p class="MsoNormal">• Sólo tres a cuatro tratamientos necesarios a intervalos semanales</p>\r\n<p> </p>\r\n<p class="MsoNormal"><span lang="EN-US">• Hasta 5 bares y 22 Hz</span></p>', 'BTL-5000 SWT POWER + LÁSER DE ALTA INTENSIDAD 12 W', '', '', '', 'btl-5000-swt-power-láser-de-alta-intensidad-12-w'),
(5, 'Integrado con la tecnología de adquisición de estado-of-the-art y el módulo de VCG, EI15 de SonoScape ofrece una amplia gama de aplicaciones integrales que incluyen lesiones relacionadas con la coronaria y la hipertrofia ventricular, todo dentro de un diseño ergonómico. El IE15 será su ECG preferida al tomar decisiones críticas.', '<p class="MsoNormal">Estilo y Speedy</p>\r\n<p class="MsoNormal">12/15 cables muestran simultáneamente</p>\r\n<p class="MsoNormal">el diseño del ordenador portátil, pantalla táctil TFT LCD de 12,1 pulgadas</p>\r\n<p class="MsoNormal">caja de adquisición actualizable</p>\r\n<p class="MsoNormal"> </p>\r\n<p class="MsoNormal">La claridad y confianza</p>\r\n<p class="MsoNormal">algoritmo avanzado de SonoScape</p>\r\n<p class="MsoNormal">paquete de análisis Pediátrica</p>\r\n<p class="MsoNormal">30-300 segundos para el análisis RR</p>\r\n<p class="MsoNormal">Amplia gama FR</p>\r\n<p class="MsoNormal">vector Cardiografía</p>\r\n<p class="MsoNormal">Impresión automática en virtud de la arritmia</p>\r\n<p class="MsoNormal"> </p>\r\n<p class="MsoNormal">La experiencia y la expectativa</p>\r\n<p class="MsoNormal">E-estación opcional</p>\r\n<p class="MsoNormal">de tarjetas TF Estándar 2 GB con adaptador SD</p>\r\n<p> </p>\r\n<p class="MsoNormal">Entrada rápida: la pantalla táctil, el teclado y el código de barras escáner</p>', 'IE 5', '', '', '', 'ie15'),
(6, '', '<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Descripción del Servicio:</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Un equipo especializado para brindar el mejor servicio</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Somos una compañia líder en servicios de Salud, que nace del interés por prestar servicios novedosos con tecnología de punta a la población que se encuentre afectada por patologías de tejidos blandos, patología osteoarticular y neurológica. Nacemos de la Empresa MEDISPORT Ltda y contamos con más de 20 años de experiencia prestando el mejor servicio a la comunidad.</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Deporte Y Alto Rendimiento</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">El deportista de cualquier nivel requiere de una asesoría médica y técnica que le de la confianza de lograr el mejoramiento esperado, estamos para servirle.</span></p>\r\n<p class="MsoNormal"><a href="http://www.fredyavella.com/index%20coach.html">Coaching Especializado</a></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Muchas de las metas que nos proponemos no se cumplen o hay dificultades, el Coaching es la vía mas expedita para hacia el éxito, no dude en consultarnos.</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Medicina Y Bienestar</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Las patologías osteoarticulares requieren además de un adecuado diagnóstico, un tratamiento profesional, podemos brindarle una atención personalizada y profesional.</span></p>\r\n<p class="MsoNormal"><a href="http://www.fredyavella.com/medreg.html">Terapia De Ondas De Choque</a></p>\r\n<p> </p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">La Terapia de Ondas de Choque es una nueva técnica utilizada para el tratamiento de condiciones crónicas tales como el codo de tenista, rodilla de saltador, calcificación de los tendones del hombro (dolor de hombro) y el dolor del Tendón de Aquiles y las condiciones que de otro modo son difíciles de tratar con fisioterapia convencional.</span></p>', 'Fredy Alberto Avella Hernandez', '', 'fisiatria, medicina, medico deportologo, ', '', 'fredy-alberto-avella-hernandez'),
(7, 'Ortopedia (Cirugía Rodilla y Pie)\r\nUbicación: Bogotá D.C. (COUNTRY CLUB) \r\nDirigido a:\r\nNiños\r\nAdolescentes\r\nMujer Mayor\r\nHombre Mayor\r\nAdulto Mayor (tercera edad)\r\nAtiendo en:\r\nClínica/Hospital\r\nCentro Médico\r\nConsultorio\r\nNombre de la Empresa: Centro de Ortopedia y Fracturas Clíniva de la Rodilla y Pie \r\nDirección: Carrera 16 # 82 29 consulrorio 203 \r\nTeléfono Trabajo:6164202 / 616 46 79\r\nCelular Trabajo:3167422532\r\nPágina Web: www.clirodilla.com ', '<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Descripción del Servicio:</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Contamos con una moderna sala, equipada para realizar procedimientos con anestesia general o regional.</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Una excelente ubicación y el disponer de instalaciones propias, nos permiten brindar exclusividad en la prestación de los servicios a nuestros usuarios con ventajas como:</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Atención personalizada</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Precios económicos</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Opciones de pago</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Planes de descuento</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Facilidad de acceso</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Parqueadero vigilado</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">ESPECIALIDADES  </span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">La Tendinitis es la inflamación de un tendón.</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Los tendones son  estructuras por las que los músculos se insertan en los huesos.</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Su función es transmitir la fuerza generada por los músculos para mover las articulaciones.</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">La Bursitis es la inflamación o irritación de una "Bursa" </span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">La Bursa es una  pequeña  bolsa sinovial situada entre el hueso y otras estructuras móviles como los músculos, la piel o los tendones y que facilitan un desplazamiento suave de estas estructuras.</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;"> </span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Atendemos</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Medicina Prepagada</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Pólizas de hospitalización y cirugías</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Accidentes escolares</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Empresas</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">EPS</span></p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">ARP(s)</span></p>\r\n<p> </p>\r\n<p class="MsoNormal"><span style="color: #1f497d; mso-themecolor: text2; mso-ansi-language: ES-CO;">Particulares</span></p>', 'Arturo Corchuelo Barbosa', '', '', '', 'arturo-corchuelo-barbosa'),
(8, 'Cardiología (Especialista en Cardiología y Medicina Nuclear)\r\nUbicación: Santander (Cúcuta) (Colsag) \r\nDirigido a:\r\nNiños\r\nAdolescentes\r\nMujer Mayor\r\nHombre Mayor\r\nAdulto Mayor (tercera edad)\r\nAtiendo en:\r\nClínica/Hospital\r\nCentro Médico\r\nConsultorio\r\nDomicilio\r\nNombre de la Empresa: SERVICIOS ESPECIALIZADOS DEL CORAZÓN FCB S.A.S \r\nDirección: Avenida 11E No 8 – 15 Barrio Colsag, consultorio 100 – 101- 204 - 208, Cucuta, Norte de Santander \r\nTeléfono Trabajo:5744718 – 5741109\r\nCelular Trabajo:3002180874\r\nPágina Web: http://www.sefcb.co/ ', '<p><span style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 30px; font-family: Signika, sans-serif; vertical-align: baseline; outline: 0px; color: #2e2e2e; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">Descripción del Servicio:</span></p>\r\n<p style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 30px; font-family: Signika, sans-serif; vertical-align: baseline; outline: 0px; color: #808080; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"> </p>\r\n<p style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 30px; font-family: Signika, sans-serif; vertical-align: baseline; outline: 0px; color: #808080; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><a style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; outline: none; color: #337ab7; cursor: pointer; background: transparent;" href="http://www.sefcb.co/index.php">Servicios especializados del Corazón</a>, es una Empresa Norte Santandereana, creada con el objeto de prestar servicios de salud, principalmente en el área cardiovascular. Para ello, se ha constituido como una unidad integral con el recurso humano, la tecnología y el direccionamiento estratégico y administrativo, que garantice a la población que requiera nuestros servicios, la mayor confiabilidad, los resultados y satisfacción esperados.</p>\r\n<p style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 30px; font-family: Signika, sans-serif; vertical-align: baseline; outline: 0px; color: #808080; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">La infraestructura desarrollada, permite atender pacientes desde la prevención primaria hasta patologías complejas, con tratamientos de intervencionismo endovascular sofisticados, lo cual ha permitido que los pacientes no tengan que desplazarse a otras ciudades.</p>\r\n<p style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 30px; font-family: Signika, sans-serif; vertical-align: baseline; outline: 0px; color: #808080; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">Queremos que la comunidad en general, los profesionales y las diferentes organizaciones que forma parte del sistema de salud, sepan que en nuestra Empresa, encuentran una opción costo/ efectiva para la atención de la patología cardiovascular.</p>\r\n<p style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 30px; font-family: Signika, sans-serif; vertical-align: baseline; outline: 0px; color: #808080; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">Especialista en Cardiología- Universidad El Bosque Especialista en Medicina Nuclear- Universidad del Rosario Especialista en Medicina Interna – Escuela de Medicina Juan N. Corpas.</p>', ' Fernando Jose Carrasco Blanco', '', '', '', 'fernando-jose-carrasco-blanco'),
(9, 'La Dra. Luz Marina Díaz es médico cirujano de la escuela Juan N Corpas, con especialización en el área de Medicina estética y Anti Aging en la Universidad John F. Kennedy de Buenos Aires, Argentina y especialización en Terapeuticas Alternativas de la universidad Juan N Corpas. Ha realizado numerosos cursos de postgrado en reconocidas universidades Europeas como la Universidad Victor Segalen de Bordeaux Francia y Educación Médica continuada con la Unión internacional de medicina estética en Mónaco, Roma, Las Vegas y Buenos Aires.\r\n\r\nEs uno de los médicos Colombianos aceptados por la Academia Americana de medicina estética (American Academy of Aesthetic Medicine) con la que ha realizado estudios de Medicina enfocados al rejuvenecimiento, el acné, y a lesiones vasculares.\r\n\r\nPor su amplia experiencia ha sido invitada como conferencista a Congresos médicos nacionales e internacionales. Su éxito y resultados la han llevado a ser Speaker de laboratorios ALLERGAN en el entrenamiento de médicos en BOTOX AVANZADO, y otras áreas de la medicina estética.\r\nPBX: 6566460\r\nCel: (317) 657 9610', '<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #7f7f7f; font-family: ''Source Sans Pro'', sans-serif; font-size: 18px; line-height: 25.7143px; text-align: justify;">Dra. Luz Marina Díaz Medicina Estética es una clínica que cuenta con más de 20 años de experiencia, promoviendo a través de sus tratamientos la mejora de tu calidad de vida. Es por ello que innovamos constantemente para poderte brindar mediante la más avanzada tecnología aplicada por los mejores profesionales, resultados reales que mejoren tu apariencia física y tu bienestar.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #7f7f7f; font-family: ''Source Sans Pro'', sans-serif; font-size: 18px; line-height: 25.7143px; text-align: justify;">Nuestra clínica cuenta con los más avanzados tratamientos en Medicina Estética, Dermatología Capilar y Medicina AntiAging, por los cuales nos catalogan como una de las clínicas estéticas más prestigiosas del país.</p>', 'luz marina diaz', '', '', '', 'luz-marina-diaz'),
(11, '\r\nFisioterapia y Rehabilitación (Fisioterapeuta)\r\nUbicación: Bogotá D.C. (CHAPINERO) \r\nDirigido a:\r\nNiños\r\nAdolescentes\r\nMujer Mayor\r\nHombre Mayor\r\nAdulto Mayor (tercera edad)\r\nAtiendo en:\r\nClínica/Hospital\r\nNombre de la Empresa: Hospital Militar Central Bogota \r\nDirección: Tranversal 3 a # 49 - 00 \r\nTeléfono Trabajo:(57)(1)3486868\r\nCelular Trabajo:5775905\r\nPágina Web: http://www.hospitalmilitar.gov.co/\r\n', '<p class="MsoNormal">Descripción del Servicio:</p>\r\n<p class="MsoNormal">En el ámbito de la Fisioterapia, el abanico de Servicios que ofrece la Deporclínica es de lo más completo. Así tenemos profesionales específicamente formados en los campos de:</p>\r\n<p class="MsoNormal">Fisioterapia Deportiva, Traumatológica y Reumatológica</p>\r\n<p class="MsoNormal">Fisioterapia Manual y Osteopática</p>\r\n<p class="MsoNormal">Fisioterapia Estética</p>\r\n<p class="MsoNormal">Disfunciones posturales y algias vertebrales</p>\r\n<p class="MsoNormal">Fisioterapia en Oncología</p>\r\n<p class="MsoNormal">Fisioterapia Pelvi-perineal y Obstétrica</p>\r\n<p class="MsoNormal">Fisioterapia en trastornos funcionales de la articulación temporo-mandibular</p>\r\n<p class="MsoNormal">Fisioterapia Neurológica y Psicomotriz</p>\r\n<p class="MsoNormal">Rehabilitación funcional en agua / Fisioterapia acuática</p>\r\n<p> </p>\r\n<p class="MsoNormal"><span lang="EN-US">Fisioterapia respiratoria</span></p>', 'Andrea Cristina Prieto Trujillo', '', '', '', 'andrea-cristina-prieto-trujillo'),
(12, 'Cardio Aspirina 81 Mg\r\nCAJA X 24 TAB\r\nBAYER S.A.', '<ul>\r\n<li style="margin-top: 0px; margin-left: auto; margin-right: auto; padding: 3px 0px; max-width: 200%; list-style: none; color: #676767; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 16.2px;">Presentación Caja</li>\r\n<li style="margin-top: 0px; margin-left: auto; margin-right: auto; padding: 3px 0px; max-width: 200%; list-style: none; color: #676767; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 16.2px;">Embalaje 24 Tabletas</li>\r\n<li style="margin-top: 0px; margin-left: auto; margin-right: auto; padding: 3px 0px; max-width: 200%; list-style: none; color: #676767; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 16.2px;">Otra información Ácido acetilsalicílico</li>\r\n<li style="margin-top: 0px; margin-left: auto; margin-right: auto; padding: 3px 0px; max-width: 200%; list-style: none; color: #676767; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 16.2px;">Requiere fórmula médica Si</li>\r\n<li style="margin-top: 0px; margin-left: auto; margin-right: auto; padding: 3px 0px; max-width: 200%; list-style: none; color: #676767; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 16.2px;">Registro Sanitario N° INVIMA 2005M-0005079</li>\r\n<li style="margin-top: 0px; margin-left: auto; margin-right: auto; padding: 3px 0px; max-width: 200%; list-style: none; color: #676767; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 16.2px;">Crónico Si</li>\r\n<li style="margin-top: 0px; margin-left: auto; margin-right: auto; padding: 3px 0px; max-width: 200%; list-style: none; color: #676767; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 16.2px;">Vencimiento Registro Sanitario AAAA-MM-DD : 2016-01-25</li>\r\n<li style="margin-top: 0px; margin-left: auto; margin-right: auto; padding: 3px 0px; max-width: 200%; list-style: none; color: #676767; font-family: ''Ope