(13, 'Tranexam Ampollas 500 Mg\r\nCAJA X 8 AMPOLLAS\r\nROPSOHN THERAPEUTICS LTDA.\r\n', '<p><span style="font-family: PideFarma, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; text-align: justify;">Control de la fibrinólisis aumentada. Disminución de la pérdida sanguínea en: Cirugía Ortopédica. Reemplazo de Cadera. Reemplazo de rodilla. Cirugía de Columna. Otorrinolaringología:Epistaxis, cirugía naso-faríngea, Hemorrágia Post-amigdalectomía. Urología: Prostatectomía. Intervenciones cardiovasculares. Intervenciones generales. Como coadyuvante en pacientes con discrasias sanguíneas o anticoagulados que sean sometidos a procesos quirúrgicos. Cirugía pediátrica.Hemorragias de vías digestivas</span></p>', 'Tranexam Ampollas 500 Mg', '', '', '', 'tranexam-ampollas-500-mg'),
(14, 'Presentación en caja por 6 unidades (preservativos)\r\nLubricado.\r\nMáximo placer.\r\nLea las instrucciones dentro del empaque.\r\nCAJA X 8 AMPOLLAS\r\nROPSOHN THERAPEUTICS LTDA.\r\n', '', 'Today Lubricado Caja X 6 Unidades', '', '', '', 'today-lubricado-caja-x-6-unidades'),
