(16, 'Guante Esteril Alfa\r\nTALLA 8 1/2\r\nMARCA GENERAL\r\n', '', 'Guante Esteril Alfa TALLA 8 1/2', '', '', '', 'guante-esteril-alfa-talla-8-1-2'),
(17, '', '<p class="MsoNormal">Frasco de 100 perlas liquidas</p>\r\n<p> </p>\r\n<p class="MsoNormal">Ha sido utilizado tradicionalmente para apoyar el sistema digestivo, puesto que ayuda con todos los trastornos estomacales, úlceras, estreñimiento, hemorroides, colitis, y en general todos los problemas del colón.</p>\r\n<p style="margin: 0px; padding: 0px 0px 20px; color: #222222; font-family: Arial, Verdana, sans-serif; font-size: 11px; line-height: 14px;">Por sus componentes contribuye al bienestar general del cuerpo, en especial para la digestión saludable.</p>\r\n<p style="margin: 0px; padding: 0px 0px 20px; color: #222222; font-family: Arial, Verdana, sans-serif; font-size: 11px; line-height: 14px;">Es reconoció por sus propiedades reconstituyentes, tiene funciones como cicatrizante, hidratante, anti-acné, analgésico, baja el colesterol, anti asma, desinfectante, anti-ulceroso.</p>\r\n<p style="margin: 0px; padding: 0px 0px 20px; color: #222222; font-family: Arial, Verdana, sans-serif; font-size: 11px; line-height: 14px;">Indicaciones: adultos tomar una (1) capsula 3 veces al día preferiblemente con las comidas.</p>', 'ALOE VERA GEL GOOD', '', '', '', 'aloe-vera-gel-good'),
(18, 'Frasco  de 60 capsulas. Promueve la capacidad del colón para recuperar los movimientos peristálticos.', '<p class="MsoNormal">El intestino comprime cerca de 1 Kg de bacterias benéficas que se alimentan de fibras digestivas lo cual provee componentes inmunes, y un ambiente digestivo saludable.  También es antimicrobiano, antibiótico, disminuye de forma natural la proliferación de la bacteria candida albicans.</p>', 'ACIDOPHILUS +40', '', '', '', 'acidophilus-40'),
(19, 'Frasco de240 ml.\r\nReduce el colesterol.', '<p style="margin: 0px; padding: 0px 0px 20px; color: #222222; font-family: Arial, Verdana, sans-serif; font-size: 11px; line-height: 14px;">Reduce el colesterol.</p>\r\n<p style="margin: 0px; padding: 0px 0px 20px; color: #222222; font-family: Arial, Verdana, sans-serif; font-size: 11px; line-height: 14px;">Preventivo de la arteriosclerosis y de la enfermedad coronaria.</p>\r\n<p style="margin: 0px; padding: 0px 0px 20px; color: #222222; font-family: Arial, Verdana, sans-serif; font-size: 11px; line-height: 14px;">Dosis: tomar 1 cucharada  3 veces al día.</p>\r\n<p style="margin: 0px; padding: 0px 0px 20px; color: #222222; font-family: Arial, Verdana, sans-serif; font-size: 11px; line-height: 14px;"><strong>Composición:</strong></p>\r\n<p style="margin: 0px; padding: 0px 0px 20px; color: #222222; font-family: Arial, Verdana, sans-serif; font-size: 11px; line-height: 14px;">Cada 100 ml de producto  contiene extracto de  alcachofa 10 ml (1:1 en alcohol de 36% G.L.</p>', 'ALCACHOFA', '', '', '', 'alcachofa'),
(20, 'Con extracto de calendula y aloe vera, proporciona una profunda hidratación a la piel y alivia la piel irritada por exposición solar y/o diversos químicos', '<p style="margin: 0px; padding: 0px 0px 20px; color: #222222; font-family: Arial, Verdana, sans-serif; font-size: 11px; line-height: 14px;">Regenera la piel gracias a sus bondades calmantes y antisépticas, actúa en forma rápida y uniforme;  </p>\r\n<p style="margin: 0px; padding: 0px 0px 20px; color: #222222; font-family: Arial, Verdana, sans-serif; font-size: 11px; line-height: 14px;">Pote de 80 ml.</p>\r\n<p style="margin: 0px; padding: 0px 0px 20px; color: #222222; font-family: Arial, Verdana, sans-serif; font-size: 11px; line-height: 14px;"> </p>\r\n<p style="margin: 0px; padding: 0px 0px 20px; color: #222222; font-family: Arial, Verdana, sans-serif; font-size: 11px; line-height: 14px;">Modo de uso:</p>\r\n<p style="margin: 0px; padding: 0px 0px 20px; color: #222222; font-family: Arial, Verdana, sans-serif; font-size: 11px; line-height: 14px;">Refrigerar por 15 minutos antes de su uso para un alivio inmediato, aplicar sobre la piel suavemente tres veces al día.</p>', 'GEL HIDRATANTE Y REFRESCANTE', '', '', '', 'gel-hidratante-y-refrescante'),
(21, 'Bolsa resellable de 500 Gr\r\nComposición: 100% linaza molida canadiense.\r\nLa linaza contiene una alta cantidad de fibra dietética la cual produce mucilagos, (sustancias gomosas) que benefician la digestión permitiendo tener una completa evacuación, limpiando su organismo de impurezas', '<p><span style="color: #222222; font-family: Arial, Verdana, sans-serif; font-size: 11px; line-height: 14px;">Es por excelencia uno de los alimentos más ricos en nutrientes y entre los cuales se encuentran los ácidos grasos esenciales Omega 3 (son llamados esenciales porque nuestro cuerpo los requiere.  El mayor beneficio que estos ácidos grasos aportan es el de mantener un sistema cardiovascular saludable regulando los niveles de colesterol malo y reduciendo la viscosidad de la sangre.  Los Omega 3 también pueden actuar a nivel metabólico incrementando la quema de grasa saturada en el organismo.  La linaza contiene lignanos los cuales son un tipo de fotoquímicos llamado fitoéstrogenos (químico de origen vegetal que simula algunas funciones de las hormonas humanas) el cual tiene efectos positivos en la salud.  Estos a su vez tienen propiedades antioxidantes al combatir los radicales libres que causan el deterioro de las células.</span></p>', 'LINAZA MOLIDA CAFÉ', '', '', '', 'linaza-molida-café'),
(22, 'Base de maquillaje fluida de larga duración SPF 15. La versión fluida de nuestro clásico Studio Fix. Proporciona un acabado natural mate. Perfecto. Cobertura regulable: media o total. De larga duración. Con factor de protección solar 15 para proteger la piel de la radiación solar.', '', 'STUDIO FIZ FLUID SPF 15', '', '', '', 'studio-fiz-fluid-spf-15'),
(23, 'Modo de uso:\r\nSobre el cabello húmedo aplicar el champú. Masajear suavemente y enjuagar. Repetir la aplicación si es necesario\r\n\r\nVolume:\r\n400ml', '<p><span style="color: #000000; font-family: ''Yanone Kaffeesatz'', Helvetica, ''Nimbus Sans L'', sans-serif; font-size: 20px; line-height: 30px;">Formulación de baja detergencia diseñada para lavar el cabello al finalizar procedimientos que emplean excesos de sustancias alcalinas, como son reducción de color, tinturas, permanentes, decoloración y alisado. Por su pH acido elimina los excesos del álcali, previniendo así la agresión y maltrato del cabello y cuero cabelludo.  </span></p>', 'Champú Profesional Neutralizante', '', '', '', 'champú-profesional-neutralizante'),
(24, '', '<p style="margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 12px; line-height: 18px; font-family: Arial, Helvetica, sans-serif; vertical-align: baseline; color: #858282;">Memorable aroma floral con notas de encaje de iris, orquídea blanca y vainilla, creado para resaltar el encanto y elegancia de la mujer única y encantadora.</p>\r\n<p style="margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 12px; line-height: 18px; font-family: Arial, Helvetica, sans-serif; vertical-align: baseline; color: #858282;">-</p>\r\n<p style="margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 12px; line-height: 18px; font-family: Arial, Helvetica, sans-serif; vertical-align: baseline; color: #858282;">INSPIRACIÓN</p>\r\n<p style="margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 12px; line-height: 18px; font-family: Arial, Helvetica, sans-serif; vertical-align: baseline; color: #858282;">Una fragancia exclusiva y hecha a la medida, que como muchas obras de arte, ha sido inspirada en una mujer única, especial y cautivadora.</p>\r\n<p style="margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 12px; line-height: 18px; font-family: Arial, Helvetica, sans-serif; vertical-align: baseline; color: #858282;">-</p>\r\n<p style="margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 12px; line-height: 18px; font-family: Arial, Helvetica, sans-serif; vertical-align: baseline; color: #858282;">FRASCO</p>\r\n<p style="margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 12px; line-height: 18px; font-family: Arial, Helvetica, sans-serif; vertical-align: baseline; color: #858282;">Un frasco excepcional que simula la delicada figura femenina, donde los pliegues remiten a una fina tela ceñida al cuerpo de la mujer. Diseño ganador del 2do lugar en la categoría mejor empaque en los premios Pentawards de nivel internacional.</p>', 'LIBERATTA PARFUM', '', '', '', 'liberatta-parfum'),
