(26, 'Código: 67559.\r\nCategorías: Esmaltes, Esmaltes Cremosos.\r\nProduct ID: 7227\r\n13,5 ml.', '', 'RELAJADA', '', '', '', 'relajada'),
(27, 'Código: 310107.\r\nCategorías: Esmaltes, Esmaltes Traslúcidos.\r\nProduct ID: 3421\r\n13,5 ML', '', 'INQUIETA', '', '', '', 'inquieta'),
(28, 'emi Ambulancia en Sitio\r\nServicio de ambulancia básica o medicalizada según se requiera, dada\r\nlas especificaciones del evento y ubicada en el sitio que el cliente lo necesite.', '<p class="MsoNormal">Ambulancia medicalizada</p>\r\n<p class="MsoNormal"> </p>\r\n<p class="MsoNormal">• Atención de emergencias, urgencias y consultas médicas en el sitio.</p>\r\n<p class="MsoNormal">• Móvil tripulada por médico, auxiliar de enfermería o tecnólogo en atención prehospitalaria y conductor.</p>\r\n<p class="MsoNormal">• Traslado cuando el médico lo considere necesario.</p>\r\n<p class="MsoNormal">• Incluye aplicación de medicamentos y material médico quirúrgico necesario en el momento de la atención.</p>\r\n<p class="MsoNormal">• Línea de orientación médica telefónica.</p>\r\n<p class="MsoNormal"> </p>\r\n<p class="MsoNormal">Ambulancia básica</p>\r\n<p class="MsoNormal"> </p>\r\n<p class="MsoNormal">• Atención de primeros auxilios.</p>\r\n<p class="MsoNormal">• Móvil tripulada por auxiliar de enfermería o tecnólogo en atención prehospitalaria y conductor.</p>\r\n<p class="MsoNormal">• Traslado según el estado en el que se encuentre el paciente.</p>\r\n<p class="MsoNormal">• No incluye aplicación de medicamentos.</p>\r\n<p class="MsoNormal">• Material quirúrgico necesario en el momento de la atención.</p>\r\n<p class="MsoNormal">• Línea de orientación médica telefónica.</p>\r\n<p class="MsoNormal"> </p>\r\n<p class="MsoNormal"> </p>\r\n<p class="MsoNormal">Beneficios</p>\r\n<p class="MsoNormal"> </p>\r\n<p class="MsoNormal">• Oportunidad de respuesta.</p>\r\n<p class="MsoNormal">• Cumplimiento de responsabilidad civil del empresario.</p>\r\n<p class="MsoNormal">• Evitamos lesiones graves por la evaluación inmediata.</p>\r\n<p class="MsoNormal">• Control pertinente del lesionado evitando situaciones de pánico colectivo.</p>\r\n<p class="MsoNormal">• Transporte directo del afectado a la institución de salud adecuada con monitoreo hasta la entrega del paciente.</p>\r\n<p class="MsoNormal">• Tranquilidad por el cumplimiento en la normatividad de eventos.</p>\r\n<p class="MsoNormal"> </p>\r\n<p class="MsoNormal"> </p>\r\n<p class="MsoNormal">Para más información escríbenos a: solucionesensalud@grupoemi.com</p>\r\n<p class="MsoNormal">o comunícate con la línea (574) 444 4364 ext 4830</p>\r\n<p class="MsoNormal"> </p>\r\n<p class="MsoNormal">Prestación de servicios sujeta a términos y condiciones.</p>\r\n<p class="MsoNormal"> </p>', 'EMI', '', '', '', 'emi');
